const initialState = [
     { 
         title: 'TO DO', 
         id: 0, 
         cards: [ 
             { id: 0, text: 'we created a static list and a static card' }, 
             { id: 1, text: 'we used a mix between material' } 
        ] 
    }, 
    { 
        title: 'DOING', 
        id: 1, 
        cards: [ 
            { id: 0, text: 'Hi' }, 
            { id: 1, text: 'we used a mix between material' }, 
            { id: 2, text: 'what?' } 
        ] 
    } 
];

const listReducer = (state = initialState, action) => {
    switch(action.type) {
        default: return state;
    }
};

export default listReducer;
